function loadImage(requestUsername = undefined, url = 'http://localhost:4000/identicapi/') {
    if (requestUsername == undefined)
        requestUsername = input.value;
    else
        input.value = requestUsername;
    //console.log('http://localhost:4000/api/'+value)
    width = document.querySelector("#width");
    height = document.querySelector("#height");
    document.querySelector("#requestUrl").value = url;
    document.querySelector("#requestUsername").value = requestUsername+"/";
    document.querySelector("#requestWidth").value = width.value+"/";
    document.querySelector("#requestHeight").value = height.value;
    
    requestUrl = url + requestUsername;
    document.querySelector("#request").value = requestUrl;

    let config = {
        headers: {
            'cache-control': 'max-age=60',
            'connection': 'close'
        }
    };
    axios.get(requestUrl, config)
        .then(function (response) {
            // handle success
            //console.log('http://localhost:4000/api/' + requestUsername + "/" + width + "/" + height);
            setImage(response.data.data.image);
        })
        .catch(function (error) {
            // handle error
            //console.log("=========Error===========")
            console.log(error);
            input.value = "Error Happened. Sooooooooooorry!";
            setImage(" data:image/png;base64,");
        });
}

function setImage(image) {
    document.getElementById("myimg").src = image;
}
function dec2hex(dec) {
    return ('0' + dec.toString(16)).substr(-2)
}

// generateId :: Integer -> String
function generateId(len) {
    var arr = new Uint8Array((len || 40) / 2)
    window.crypto.getRandomValues(arr)
    return Array.from(arr, dec2hex).join('')
}

